const navBarStyle = {
  backgroundColor: "#EEEEEE",
  
  width: "100%",
  height: "60px"
}

const NavBar = () => (
  <div className="NavBar" style={navBarStyle}>
    NAVBAR
  </div>
)

export default NavBar
